  ('01', '006', '00202', '01', '00226', 'Sắp xếp toàn bộ diện tích tự nhiên, quy mô dân số của các phường Khâm Thiên, Thổ Quan, Văn Chương, một phần diện tích tự nhiên, quy mô dân số của các phường Điện Biên, Hàng Bột, Văn Miếu - Quốc Tử Giám, phần còn lại của phường Cửa Nam sau khi sắp xếp theo quy định tại các khoản 1, 2, 3 Điều này, phần còn lại của phường Lê Đại Hành sau khi sắp xếp theo quy định tại khoản 6, khoản 8 Điều này, phần còn lại của phường Nam Đồng sau khi sắp xếp theo quy định tại khoản 9, khoản 10 Điều này, phần còn lại của phường Nguyễn Du sau khi sắp xếp theo quy định tại khoản 2, khoản 6 Điều này và phần còn lại của phường Phương Liên - Trung Tự sau khi sắp xếp theo quy định tại khoản 10 Điều này thành phường mới có tên gọi là phường Văn Miếu - Quốc Tử Giám.', '1656/NQ-UBTVQH15'),
